import React from "react";
import { Root, Checkbox } from "./style";

const HeaderIconList = () => {
  return (
    <Root>
      <HoverIcon resource={cameraIcon} />
      <HoverIcon resource={alertIcon} />
      <HoverIcon resource={alertIcon} />
      <Checkbox role="switch" />
    </Root>
  );
};

export default HeaderIconList;
